import { createSlice } from "@reduxjs/toolkit";

const dataSlice = createSlice({
  name: "data",
  initialState: [],
  reducers: {
    setData(state) {
        return initialState.push(...state)
    },
  },
});

export const {setData} = dataSlice.actions
export default dataSlice.reducer
